class App extends Component{
    render()
    {
        return (
            <>
                <Heading />
                <Table />
                <Parah />
                <Heading />
                <Message />
                <ul>
                    <li> Sum is : {Add(20, 10)}</li>
                    <li> Subtraction is : {Sub(40, 15)}</li>
                    <li> Multipulication is : {Mul(10, 5)}</li>
                    <li> Division is : {Div(37, 3)}</li>
                </ul>
                <Cards />
            </>
        );
    }
}

export default App;
